import './App.css';

function App() {
  return (
    <body>
      <div className="App">
        <p>Hello World!</p>
      </div>
      <div>
        <form onSubmit={this.handleSubmit}>
          <input type="file" accept="video/*" id="upload" />
          <input type="submit" value="Envoyer" />
        </form>
      </div>
    </body>
  );
}

export default App;
